import * as React from 'react';
import WebView from 'react-native-webview';
import WebViewBridge from "../../WebViewBridge";

const TestDappListHtml = `
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" name="viewport" content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
  <title>Dapp列表</title>
</head>
<body>
<h2>这里是dapp列表，自行完善吧</h2>
<a href="javascript:openDapp(1,'测试Dapp详情页','http://192.168.1.104/dapp.html');"><img width="64px" height="64px" src="data:image/png;base64," alt="" srcset=""></a>
<script>
function openDapp(chainId,name,uri){
    console.log('open dapp',chainId);
    // 发送给app打开dapp页面
    window.ReactNativeWebView.postMessage(
        '{"type":2,"data":{"chainId":'+chainId+',"name":"'+name+'","uri":"'+uri+'"}}'
    );
}
</script>
</body>
</html>
`;


export default function DappList(props){
    const {navigation} = props;
    const webViewBridge = new WebViewBridge();
    webViewBridge.setNavigation(navigation);
    // dapp列表发过来的消息
    const onMessage = (evt) => {
        console.log(evt.nativeEvent.data);
        webViewBridge.onEvent(JSON.parse(evt.nativeEvent.data));
    }
    return (
        <WebView
            ref={r => webViewBridge.setWebview(r)}
            source={{html: TestDappListHtml}}
            onMessage={onMessage}
        />
    );
}
